import React from 'react'

import { OpenWeather } from 'open-weather-lib'
import 'open-weather-lib/dist/index.css'


const WEATHER_DATA = {
  appId:'5b7a853482eef7ced3f0f650d984cf10',
  unit:'metric',
  type:'current',
  location:{
  	city:'berlin',
  	country:''
  },
  cord:{
  	lat:'20.6565116',
  	lon:'-103.4128702'
  },
  timeRequest:21
};

const App = () => {
  return <OpenWeather 
  			weatherData={WEATHER_DATA}
  		/>
}

export default App
